(1, 'vamrrhh@virtualairlinesmanager.net', 'vamrrhh@virtualairlinesmanager.net', 'vamrrhh@virtualairlinesmanager.net', 'Welcome!!\r\n\r\nWe would like to personally welcome you as a new pilot.<p>\r\n\r\nIn next 24 hours your application will be validated, you will receive a new email with your callsign. This callsign is your login into the VAM system. <p>\r\nIn case you do not receive any email or if you have problems with the system write us an email to admin@virtualairlinesmanager.net <p>\r\n\r\nWe hope you enjoy with us.\r\n\r\n\r\n\r\n\r\n\r\n', '');
